import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Prospecto } from '../lista/lista.component'
import { ApiService } from '../Services/api.service';

@Component({
  selector: 'app-evaluacion-data',
  templateUrl: './evaluacion.component.html'
})
export class EvaluacionComponent implements OnInit {

  prospecto: Prospecto = {
    prospectoID: 0,
    nombre: "",
    apellidoPaterno: "",
    apellidoMaterno: "",
    calle: "",
    numero: 0,
    colonia: "",
    codigoPostal: 0,
    telefono: "",
    rfc: "",
    observaciones: "",
    documentos: [],
    estatus: "Enviado"
  }
  constructor(private route: ActivatedRoute, private apiServices: ApiService) { }

  ngOnInit() {
    const id = Number(this.route.snapshot.paramMap.get('id'));
    this.apiServices.getOne(id).subscribe(data => this.prospecto = data.data);
  }

  descargarArchivo(item: any) {
    const downloadLink = document.createElement('a');
    const fileName = item.nombre;

    downloadLink.href = item.archivo;
    downloadLink.download = fileName;
    downloadLink.click();
  }
}
